import React, { Fragment } from 'react';
import './App.css';

// Components
import AddTodo from './components/addTodo';

function App() {
  return (
    <Fragment>
      <div className='container'>
        <AddTodo />
      </div>
    </Fragment>
  );
}

export default App;
